import React from 'react';

const Customer = () => {
  const products = [
    {
      name: "The Unicorn",
      description: "They exist!",
      price: "$9.99",
      image: "heart_icon.png" // You should replace this with the actual image path
    },
    {
      name: "The Fashionista",
      description: "You know he's got his own personal stylist.",
      price: "$9.99",
      image: "food.jpg" // You should replace this with the actual image path
    },
    {
      name: "The Drooler",
      description: "Look at that crazy and cute face!",
      price: "$9.99",
      image: "food.jpg" // You should replace this with the actual image path
    }
  ];

  return (
    <div className="container mx-auto px-4">
      <header className="text-center my-10">
        <h1 className="text-4xl font-bold">Get Doggy products!</h1>
        <p className="text-xl mt-3">Times are tough. Liven up your home with some cute Doggy products. üê∂</p>
      </header>
      
      <div className="flex flex-wrap -mx-4 justify-center">
        {products.map((products) => (
          <div className="w-full sm:w-1/2 md:w-1/3 px-4 mb-8" key={products.name}>
            <div className="bg-white rounded-lg shadow-lg overflow-hidden flex flex-col items-center text-center">
              <img src={products.image} className="w-full" />
              <div className="p-6">
                <h3 className="text-xl font-bold mb-2">{products.name}</h3>
                <p className="text-gray-800 mb-4">{products.description}</p>
                <span className="text-lg font-bold">{products.price}</span>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Customer;
